import React from "react";
import ReactDOM from "react-dom";
import MainImage from "../images/navbarLogo.png";
import LinkImage from "../images/linkedin-logo.png";
import TwitImage from "../images/twitter-logo.png";
import InstaImage from "../images/instagram-logo.png";
import { Nav, Navbar, NavDropdown, Container } from "react-bootstrap";
import "./styles/navbarStyle.css";

function NavBar() {
  return (
    <Navbar
      background-color="#444444"
      variant="dark"
      expand="lg"
      className="nav-bg"
    >
      <Container bsPrefix="nav-container">
        <Navbar.Brand href="#home">
          <img src={MainImage} width="50" height="50" alt="" />{" "}
        </Navbar.Brand>
        <Navbar.Brand href="#home">
          <span className="nav-text">Raffay's Website </span>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">
              <span className="nav-text">About Me </span>
            </Nav.Link>
            <Nav.Link href="#link">
              <span className="nav-text">Projects</span>
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
        <Nav.Link href="#home" className="mr-auto">
          <img src={LinkImage} width="30" height="30" alt="" />{" "}
        </Nav.Link>
        <Nav.Link href="#home" className="mr-auto">
          <img src={TwitImage} width="30" height="30" alt="" />{" "}
        </Nav.Link>
        <Nav.Link href="#home" className="mr-auto">
          <img src={InstaImage} width="30" height="30" alt="" />{" "}
        </Nav.Link>
      </Container>
    </Navbar>
  );
}

export default NavBar;
